import React from 'react';
import styled from 'styled-components';
import '../../App.css';

const LogoS = styled.div`
  display: flex;
  font-family: 'bitbit';
  vertical-align: bottom;
  align-items:center;
  width : 200px;
  height: 36px;
  cursor: pointer;
  margin-left: 10px;
  text-align: center;
  font-weight: 100;
  font-size: 32px;
`;

function Logo() {

  return <LogoS><Link to="/about">About</Link></LogoS>;
}

export default Logo;

